css:
@-moz-document url-prefix("https://karachan.org"){
/* 


Kontrast Karachan 

Jak chcecie uzywac to uzywajcie na tomorrow i fajnie bedzie wtedy


*/
 body {
    background-color:black !important;
    color: white;
}
s {
    color: #cecece !important;
    background-color: black !important;
}
.quote {
    color: #EEFF00 !important;
}
.post {
    background-color: black !important;
    border-color: #EEFF00 !important;
    border-radius: 0px !important;
    margin: 5px !Important;
}
.thread {
    background-color: black !important;
    border-radius: 0px;
    padding: 15px !important;
}
.postInfo {
    margin: 6px !important;
}
a:link {
    color: #EEFF00;
}
a:visited {
    color: #EEFF00;
}
a:hover {
    color: #F5FF66 !important;
}
.watch-button-container {
    color: #EEFF00 !important;
}
hr {
    opacity: 0.2;
    background-color: #EEFF00;
}
.grecaptcha-badge {
    display:none !important;
}

/* 

[cool] [czesc]


*/
 .boardTitle:after {
    content:" - Kontrast Karachan";
    font-size: 13px;
    letter-spacing:2px;
    margin-left:15px;
    background-color:#EEFF00;
    color:black;
}
}
